import React from 'react';
import {Card} from "react-bootstrap";
import Menu from "./Menu";
import UnderMenu from "./UnderMenu";

const Interface = () => {
    return (
        <Card style={{ width: '18rem' }}>
            <Card.Header>
                <Menu/>
            </Card.Header>
            <Card.Body>
                <Card.Title>
                    <UnderMenu/>
                </Card.Title>
                <Mails></Mails>
            </Card.Body>
        </Card>
    );
};

export default Interface;
